class DataProcessor:
    @staticmethod
    def process_deletions_for_date(date: str) -> bool:
        """Process deletions for a specific date."""
        try:
            conn = sqlite3.connect('data.db')
            cursor = conn.cursor()
            cursor.execute("DELETE FROM records WHERE deletion_date = ?", (date,))
            conn.commit()
            conn.close()
            return True
        except Exception as e:
            print(f"Error processing deletions: {e}")
            return False

