class DataValidator:
    def validate_zip_plus4(self, zip_code: str) -> bool:
        """Validate ZIP+4 codes."""
        pattern = r'^\d{5}(-\d{4})?$'
        return bool(re.match(pattern, zip_code))

    def validate_loan_records(self, amount: str) -> bool:
        """Validate loan records, accepting zero and blank."""
        return amount.strip() == "" or float(amount or 0) >= 0

    def validate_duns_number(self, duns: str, action_type: str, date: str) -> bool:
        """Validate DUNS numbers based on action type and date."""
        if not duns or len(duns) != 9 or not duns.isdigit():
            return False
        return True

    def validate_zip_code(self, zip_code: str, allow_truncate: bool = False) -> bool:
        """Validate ZIP codes, optionally allowing truncation."""
        if allow_truncate:
            return bool(re.match(r'^\d{1,5}$', zip_code))
        return bool(re.match(r'^\d{5}$', zip_code))

    def prevent_duplicate_transactions(self, transaction_id: str) -> bool:
        """Prevent duplicate transactions from being published."""
        conn = sqlite3.connect('data.db')
        cursor = conn.cursor()
        cursor.execute("SELECT COUNT(*) FROM transactions WHERE id = ?", (transaction_id,))
        count = cursor.fetchone()[0]
        conn.close()
        return count == 0

