class DataAnalyst:
    def retrieve_published_fabs_files(self) -> List[Dict]:
        """Retrieve published FABS files."""
        conn = sqlite3.connect('data.db')
        cursor = conn.cursor()
        cursor.execute("SELECT * FROM fabs_files WHERE published = 1")
        files = cursor.fetchall()
        conn.close()
        return files

    def filter_grants_only(self, records: List[Dict]) -> List[Dict]:
        """Filter records to only include grants."""
        return [r for r in records if r.get('record_type') == 'grant']

    def derive_office_names(self, office_codes: List[str]) -> Dict[str, str]:
        """Derive office names from office codes."""
        office_names = {
            '001': 'Headquarters',
            '002': 'Regional Office',
            '003': 'Field Office'
        }
        return {code: office_names.get(code, 'Unknown') for code in office_codes}
